import React, { useState, useEffect } from "react";
// import axios from "axios";

const axios = require("axios");

axios.get("/api/real_time_api").then((resp) => {
  console.log("pool", resp.data);
});

const RealTimeApi = (props) => {
  const [state, setState] = useState([]);
  useEffect(() => {
    axios.get("/api/real_time_api").then((res) => setState(res.data));
  }, []);

  console.log(state.response_text);

  return (
    <div>
      <p>Information from rtpi:</p>
      <p>{state.response_text}</p>
    </div>
  );
};

export default RealTimeApi;
